  constructor(props){
    super(props); 
    this.handlechange = this.handlechange.bind(this); 
  }
    handlechange(event) {
      const text = event.target.value;
      this.props.onChange(this.props.id, text)

    }

render()
{
    return (
    <div >

     <Navbar className = "navbar_css" bg="dark" variant="dark">
        <Nav className="mr-auto">
        <Navbar.Brand  value= {'Accountadmin'} className="links"href="/Accountadmin" >Account admin</Navbar.Brand>
          <br></br>
        <Nav.Link className="links" href="#home">Account Summary</Nav.Link>
         <br></br>
        <Nav.Link  className="links" href="#features">Statements</Nav.Link>
         <br></br>
        <Nav.Link className="links"  href="#pricing">payment&Transfer</Nav.Link>
         <br></br>
       </Nav>
      </Navbar>
        </div>
    )}

 }
export default NavBar;
